const PostLink = props => (
    <li>
      <Link href="/p/[id]" as={`/p/${props.id}`}>
        <a>{props.title}</a>
      </Link>
    </li>
  );

  export default function Blog() {
    return (
      <Layout>
        <h1>My Blog</h1>
        <ul>
          <PostLink id="hello-nextjs" title="Hello Next" />
          <PostLink id="learn-nextjs" title="Learn Next" />
          <PostLink id="deploy-nextjs" title="Deploy Next" />
        </ul>
      </Layout>
    );
  }
